import React from "react";
import "./App.css";

import { BrowserRouter, Routes, Route,Outlet, Link } from "react-router-dom";
import Home from "./Composantes/Home/Home";


function App() {
  return (
    <>
    <TestimonialsProvider>
       <BrowserRouter>
<Header/>

      <Routes>
          <Route path="/" index element={<Home />} />



      </Routes>
    </BrowserRouter>


    <Footer/>
    </TestimonialsProvider>

    </>
  );
}

export default App;
